import React, { Component } from "react";
import { Redirect } from "react-router-dom";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
//import MarkdownElement from "@material-ui/docs/MarkdownElement";
import "./admin.css";
import { NavLink } from "react-router-dom";

import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import IconButton from "@material-ui/core/IconButton";
import Email from "@material-ui/icons/Email";
import Lock from "@material-ui/icons/Lock";

import Input from "@material-ui/core/Input";
import InputLabel from "@material-ui/core/InputLabel";
import InputAdornment from "@material-ui/core/InputAdornment";
import FormHelperText from "@material-ui/core/FormHelperText";
import FormControl from "@material-ui/core/FormControl";
import TextField from "@material-ui/core/TextField";
import Visibility from "@material-ui/icons/Visibility";
import VisibilityOff from "@material-ui/icons/VisibilityOff";

import { PostData } from "../../services/PostData";

const styles = theme => ({
  root: {
    flexGrow: 1,
    height: "100vh"
  },
  loginContainer: {
    height: "100vh"
  },
  paper: {
    padding: theme.spacing.unit * 2,
    color: theme.palette.text.secondary
  },
  control: {
    padding: theme.spacing.unit * 2
  }
});

class Login extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: "",
      password: "",
      remember_me: "",
      isLoggedIn: false
    };

    this.login = this.login.bind(this);
    this.onChange = this.onChange.bind(this);
  }

  login() {
    if (this.state.email && this.state.password) {
      PostData("login", this.state).then(result => {
        let reponseJSON = result;
        if (reponseJSON.data) {
          sessionStorage.setItem("user", JSON.stringify(reponseJSON.data));
          console.log(sessionStorage.getItem("user"));
          this.setState({ isLoggedIn: true });
        } else {
          console.log("Login error!");
        }
      });
    }
  }

  onChange(e) {
    this.setState({
      [e.target.name]: e.target.value
    });
    //console.log(this.state);
  }

  render() {
    if (this.state.isLoggedIn) {
      return <Redirect to="/admin/dashboard" />;
    }

    const { classes } = this.props;

    // if (sessionStorage.getItem("user")) {
    //   return <Redirect to="/admin/dashboard" />;
    // }

    return (
      <div className={classes.root}>
        <Grid
          className={classes.loginContainer}
          container
          direction="row"
          justify="center"
          alignItems="center"
        >
          <Grid item sm={12} md={4} lg={2} xs={12}>
            <FormControl fullWidth className={classes.margin}>
              <InputLabel htmlFor="input-with-icon-adornment">
                Your Email
              </InputLabel>
              <Input
                id="input-with-icon-adornment"
                name="email"
                label="Email"
                onChange={this.onChange}
                startAdornment={
                  <InputAdornment position="end">
                    <Email />
                  </InputAdornment>
                }
              />
            </FormControl>
            <FormControl fullWidth className={classes.margin}>
              <InputLabel htmlFor="input-with-icon-adornment">
                Your Password
              </InputLabel>
              <Input
                id="input-with-icon-adornment"
                type="password"
                name="password"
                label="Password"
                onChange={this.onChange}
                endAdornment={
                  ((
                    <InputAdornment position="start">
                      <Lock />
                    </InputAdornment>
                  ),
                  (
                    <InputAdornment position="end">
                      <IconButton
                        aria-label="Toggle password visibility"
                        onClick={this.handleClickShowPassword}
                      >
                        {this.state.showPassword ? (
                          <Visibility />
                        ) : (
                          <VisibilityOff />
                        )}
                      </IconButton>
                    </InputAdornment>
                  ))
                }
              />
            </FormControl>
          </Grid>
        </Grid>
      </div>
      // <div className="p-grid p-justify-center" style={{ height: "100vh" }}>
      //   <div className="p-sm-12 p-md-4 p-lg-3 p-xl-3 p-col-align-center">
      //     <div className="p-col-12">
      //       <div className="p-inputgroup">
      //         <span className="p-inputgroup-addon">
      //           <i className="pi pi-envelope" />
      //         </span>
      //         <InputText
      //           name="email"
      //           placeholder="Email"
      //           onChange={this.onChange}
      //         />
      //       </div>
      //     </div>
      //     <div className="p-col-12">
      //       <div className="p-inputgroup">
      //         <span className="p-inputgroup-addon">
      //           <i className="pi pi-lock" />
      //         </span>
      //         <Password
      //           id="password"
      //           name="password"
      //           value={this.state.value}
      //           onChange={this.onChange}
      //           placeholder="Password"
      //         />
      //       </div>
      //     </div>
      //     <div className="p-col p-grid">
      //       <div className="p-col-7">
      //         <Checkbox
      //           inputId="remember_me"
      //           name="remember_me"
      //           value="remember"
      //           checked={this.state.isChecked}
      //           onChange={this.onChange}
      //         />
      //         <label
      //           htmlFor="remember_me"
      //           className="p-checkbox-label remember-me"
      //         >
      //           Remember me
      //         </label>
      //       </div>
      //       <div className="p-col-5 text-right">
      //         <Button
      //           label="Login"
      //           className="p-button-raised p-button-secondary"
      //           onClick={this.login}
      //         />
      //       </div>
      //     </div>
      //     <div className="p-col-12">
      //       <div className="reset-password">
      //         <NavLink to="/admin/login/reset-password">
      //           <span>Forgot your password?</span>
      //         </NavLink>
      //       </div>
      //     </div>
      //   </div>
      // </div>
    );
  }
}

Login.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Login);
